			position: absolute;
			left: 4px;
			bottom: 6px;
			content: "";
			display: inline-block;
			width: 12px;
			height: 12px;
			border-radius: 10px;
			background: transparent;
			-webkit-transition: right .4s ease;
			-o-transition: right .4s ease;
			transition: right .4s ease;
		}
	}
}

.input-radio {
	display: none;

	&:checked+.label-radio__text {
		color: $color-ds75;

		&:before {
			border: 1px solid $color-purple;
		}

